{

    internal InnerConnectorProfileBasicAuthCredentialsFactory BasicFactory { get; set; }

    internal InnerConnectorProfileApiKeyCredentialsFactory ApiKeyFactory { get; set; }

    internal InnerConnectorProfileOAuth2CredentialsFactory Oauth2Factory { get; set; }

    internal InnerConnectorProfileCustomAuthCredentialsFactory CustomFactory { get; set; }

    protected override Humidifier.AppFlow.ConnectorProfileTypes.CustomConnectorProfileCredentials Create()
    {
        var customConnectorProfileCredentialsResult = CreateCustomConnectorProfileCredentials();
        factoryAction?.Invoke(customConnectorProfileCredentialsResult);

        return customConnectorProfileCredentialsResult;
    }

    private Humidifier.AppFlow.ConnectorProfileTypes.CustomConnectorProfileCredentials CreateCustomConnectorProfileCredentials()
    {
        var customConnectorProfileCredentialsResult = new Humidifier.AppFlow.ConnectorProfileTypes.CustomConnectorProfileCredentials();

        return customConnectorProfileCredentialsResult;
    }
    public override void CreateChildren(Humidifier.AppFlow.ConnectorProfileTypes.CustomConnectorProfileCredentials result)
    {
        base.CreateChildren(result);

        result.Basic ??= BasicFactory?.Build();
        result.ApiKey ??= ApiKeyFactory?.Build();
        result.Oauth2 ??= Oauth2Factory?.Build();
        result.Custom ??= CustomFactory?.Build();
    }

} // End Of Class

